import styled from 'styled-components';

export const Container = styled.div`

background-color: rgb(243, 241, 241);
display: flex;
flex-direction: column;
align-items: center;
width: 100%;
#myCart{
    display: flex;
    height: auto;
    flex-direction: column;
    align-items: flex-start;
    width: 50%;
}
h1 {
    margin-top: 2%;
    min-width: 100%;
    text-align: center;
    margin-left: 2%;
}
.productList{
    width: 100%;
    padding-left: 0%;
}

#btnCheckout{
    background: rgb(20, 215, 179);
    color: black;
    margin-top: 2%;
    padding: 12px 20px;
    border: none;
    border-radius: 4px;
}
`;
